import Head from "next/head";
import Layout from "../components/Layout";

const About = () => {
	return (
		<Layout>
			<Head>
				<title>BitzPrice</title>
			</Head>
			<div>
				<h1>About BitzPrice</h1>
				<p>Aplication to view Bitcoin prices</p>
			</div>
		</Layout>
	);
};

export default About;
